import './Card.css';
function Card(props) {
return (
    <div className="card">
        <h3>{props.title}</h3>
        <p>{props.description}</p>
        <img src="test.png" alt="Test" width="200" height="200"/>
        <button clas><a href={props.link}>Visit the Project</a></button>
    </div>
)
}


export default Card;
